[{"location":"guides/models/manage-the-electronic-circuit/#Manage-the-electronic-circuit","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"","category":"section"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"With AutomationLabs you can use several processors, such as the central processing unit (CPU) or the graphics processing unit (GPU) for tuning models. Also, it is possible to use several cpu cores to tune the models in parallel during the hyperparameters optimization.","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/#Central-processing-unit","page":"Manage the electronic circuit","title":"Central processing unit","text":"","category":"section"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"The list of tuned models with several cores for hyperparameters optimization are:","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"Architecture Multi-threads CPU Multi-processes CPU\nLinear [ ] [ ]\nFnn [x] [x]\nRbf [x] [x]\nIcnn [x] [x]\nResNet [x] [x]\nPolyNet [x] [x]\nDenseNet [x] [x]\nNeuralNetODE_type1 [x] [x]\nNeulraNetODE_type2 [x] [x]\nRnn [x] [x]\nLstm [x] [x]\nGru [x] [x]","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"where, [ ] not several cores and [x] several cores.","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"In order to tune a model with multi-threads, the computation_processor parameter is modified, such as:","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"~> julia --threads 4","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"(Image: julia-terminal-threads)","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"julia> model(:tune; \n          project_name = \"QTP_test\",\n          model_name = \"model_qtp_nonlinear\",\n          io = \"io_qtp\",\n          computation_solver = \"radam\",\n          computation_maximum_time = Dates.Minute(15),\n          model_architecture = \"fnn\", \n          computation_processor = \"cpu_threads\",\n          )","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"In order to tune a model with multi-processes, the computation_processor parameter is modified, such as:","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"~> julia -p 4","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"(Image: julia-terminal-processes)","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"julia> model(:tune; \n          project_name = \"QTP_test\",\n          model_name = \"model_qtp_nonlinear\",\n          io = \"io_qtp\",\n          computation_solver = \"RADAM\",\n          computation_maximum_time = Dates.Minute(15),\n          model_architecture = \"Fnn\", \n          computation_processor = \"CPUProcesses\",\n          )","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"By default the AutomationLabs tool uses single thread computing.","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/#Graphics-processing-unit","page":"Manage the electronic circuit","title":"Graphics processing unit","text":"","category":"section"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"By default the AutomationLabs tool will use the graphics processing unit calculation if it is available and CUDA.jl is installed and running on the machine. However, the GPU capability depends upon the blackbox model and the algorithm chosen to tune the weights.The list of tuned models with GPU capabilities are:","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"Architecture GPU\nLinear [ ]\nFnn [x]\nRbf [x]\nIcnn [x]\nResNet [x]\nPolyNet [x]\nDenseNet [x]\nNeuralNetODE_type1 [x]\nNeulraNetODE_type2 [x]\nRnn [x]\nLstm [x]\nGru [x]","category":"page"},{"location":"guides/models/manage-the-electronic-circuit/","page":"Manage the electronic circuit","title":"Manage the electronic circuit","text":"where, [ ] not gpu and [x] gpu.","category":"page"},{"location":"guides/dashboards/parameters/#Parameters","page":"Parameters","title":"Parameters","text":"","category":"section"},{"location":"guides/dashboards/parameters/#:rawdata","page":"Parameters","title":":rawdata","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Plot from rawdata.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: dash\nExample: dash(:rawdata)","category":"page"},{"location":"guides/dashboards/parameters/#Mandatory-parameters","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/dashboards/parameters/#data_name","page":"Parameters","title":"data_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set data name of the data to plot.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:rawdata, ...)\nExample: dash(:rawdata, data_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#project_name","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the data to plot.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:rawdata, ...)\nExample: dash(:rawdata, project_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#dash_name","page":"Parameters","title":"dash_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set name of the dasboard.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:rawdata, ...)\nExample: dash(:rawdata, dash_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#recipe","page":"Parameters","title":"recipe","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set the recipe of the dasboard.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: temporal\nAccepted: temporal, box\nMethod argument: dash(:rawdata, ...)\nExample: dash(:rawdata, recipe = \"temporal\")","category":"page"},{"location":"guides/dashboards/parameters/#:iodata","page":"Parameters","title":":iodata","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Plot from iodata.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: dash\nExample: dash(:iodata)","category":"page"},{"location":"guides/dashboards/parameters/#Mandatory-parameters-2","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/dashboards/parameters/#data_name-2","page":"Parameters","title":"data_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set data name of the data to plot.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:iodata, ...)\nExample: dash(:iodata, data_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#project_name-2","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the data to plot.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:iodata, ...)\nExample: dash(:iodata, project_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#dash_name-2","page":"Parameters","title":"dash_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set name of the dasboard.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:iodata, ...)\nExample: dash(:iodata, dash_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#recipe-2","page":"Parameters","title":"recipe","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set the recipe of the dasboard.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: temporal\nAccepted: temporal, box\nMethod argument: dash(:iodata, ...)\nExample: dash(:iodata, recipe = \"temporal\")","category":"page"},{"location":"guides/dashboards/parameters/#:ls","page":"Parameters","title":":ls","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"List dashboards from a dedicated project.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: dash\nExample: dash(:ls)","category":"page"},{"location":"guides/dashboards/parameters/#Mandatory-parameters-3","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/dashboards/parameters/#project_name-3","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the dashboards to list.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:ls, ...)\nExample: dash(:ls, project_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#:rm","page":"Parameters","title":":rm","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Plot from iodata.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: dash\nExample: dash(:iodata)","category":"page"},{"location":"guides/dashboards/parameters/#Mandatory-parameters-4","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/dashboards/parameters/#dash_name-3","page":"Parameters","title":"dash_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set the name of the dashboard to remove.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:rm, ...)\nExample: dash(:rm, dash_name = \"name\")","category":"page"},{"location":"guides/dashboards/parameters/#project_name-4","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the dashboard to remove.","category":"page"},{"location":"guides/dashboards/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: dash(:rm, ...)\nExample: dash(:rm, project_name = \"name\")","category":"page"},{"location":"guides/dashboards/administrate-dashboards/#Interact-with-dashboards","page":"Interact with dashboards","title":"Interact with dashboards","text":"","category":"section"},{"location":"guides/dashboards/administrate-dashboards/#Create-a-dashboard-from-raw-data","page":"Interact with dashboards","title":"Create a dashboard from raw data","text":"","category":"section"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"To create a dashboard from raw data you can use the dash command, such as:","category":"page"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"julia> dash(:rawdata, \n    project_name = \"project\", \n    data_name = \"data\", \n    recipe = \"temporal\",\n    dash_name = \"dash_temporal\",\n)","category":"page"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"where project_name is the name of the project,data_name is the data name, recipe is the dashboard type, dash_name is dash board name when saved on the database.","category":"page"},{"location":"guides/dashboards/administrate-dashboards/#Create-a-dashboard-from-io-data","page":"Interact with dashboards","title":"Create a dashboard from io data","text":"","category":"section"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"To create a dashboard from io data you can use the dash command, such as:","category":"page"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"julia> dash(:iodata, \n        project_name = \"project\", \n        data_name = \"data\", \n        recipe = \"temporal\",\n        dash_name = \"dash_temporal\",\n    )","category":"page"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"where project_name is the name of the project,data_name is the data name, recipe is the dashboard type, dash_name is dash board name when saved on the database.","category":"page"},{"location":"guides/dashboards/administrate-dashboards/#List-dashboards","page":"Interact with dashboards","title":"List dashboards","text":"","category":"section"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"You can list the dashboards from a project:","category":"page"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"julia> dash(:ls, project_name = \"project\")","category":"page"},{"location":"guides/dashboards/administrate-dashboards/#Remove-a-dashboard","page":"Interact with dashboards","title":"Remove a dashboard","text":"","category":"section"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"You can remove a dashboard from a project:","category":"page"},{"location":"guides/dashboards/administrate-dashboards/","page":"Interact with dashboards","title":"Interact with dashboards","text":"julia> dash(:rm, project_name = \"project\", dash_name = \"dash\")","category":"page"},{"location":"guides/projects/parameters/#Parameters","page":"Parameters","title":"Parameters","text":"","category":"section"},{"location":"guides/projects/parameters/#:create","page":"Parameters","title":":create","text":"","category":"section"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Create a project for AutomationLabs.","category":"page"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: project\nExample: project(:create, name = \"name_project\")","category":"page"},{"location":"guides/projects/parameters/#Optional-parameters","page":"Parameters","title":"Optional parameters","text":"","category":"section"},{"location":"guides/projects/parameters/#name","page":"Parameters","title":"name","text":"","category":"section"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Set project name.","category":"page"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: project(:create, ...)\nExample: project(:create, name = \"name_project\")","category":"page"},{"location":"guides/projects/parameters/#:ls","page":"Parameters","title":":ls","text":"","category":"section"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"List the project that are available.","category":"page"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: project\nExample: project(:ls)","category":"page"},{"location":"guides/projects/parameters/#:rm","page":"Parameters","title":":rm","text":"","category":"section"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Remove a project.","category":"page"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: project\nExample: project(:rm, name = \"name_project\")","category":"page"},{"location":"guides/projects/parameters/#Mandatory-parameters","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/projects/parameters/#name-2","page":"Parameters","title":"name","text":"","category":"section"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Set project name to delete.","category":"page"},{"location":"guides/projects/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: project(:rm, ...)\nExample: project(:rm, name = \"name_project\")","category":"page"},{"location":"reference/cli/#CLI","page":"CLI","title":"CLI","text":"","category":"section"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"Here you can find the main command line for the package:","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"julia> project(...)","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"AutomationLabs configuration function that manage projects.","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"julia> data(...)","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"AutomationLabs configuration function that manage data.","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"julia> model(...)","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"AutomationLabs configuration function that manage controllers:","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"julia> controller(...)","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"AutomationLabs configuration function that manage models.","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"julia> dash(...)","category":"page"},{"location":"reference/cli/","page":"CLI","title":"CLI","text":"AutomationLabs configuration function that manage dashboards.","category":"page"},{"location":"guides/models/blackbox-models-description/#Blackbox-models-description","page":"Blackbox models description","title":"Blackbox models description","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/#Parametric","page":"Blackbox models description","title":"Parametric","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/#Linear-model","page":"Blackbox models description","title":"Linear model","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The linear model is the simplest model with only a wieights matric, it is defined as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h = W(v)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where, h is the output, W is a weighting matrix and v is the input. In the case of the dynamical system identification with h the predicted state (hatx_k+1) and v the state and input at current time (xk uk) , the linear model can be redesign as classical linear state space model:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"hatxk+1 = A xk + Buk","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where, A is the state matrix and B the input matrix from W. The Linear model can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"lls\",\n        model_architecture = \"linear\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Neural-networks","page":"Blackbox models description","title":"Neural networks","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The artificial neuron is derived from the biological neuron. Modelling a biological neuron is complex and, its mathematical modelling is carried out with several simplifying assumptions, retaining only the basic principle of its ability to communicate through electrical signals. A illustration of a biological description is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: neuron-cell-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Diagram of the simplification of the biological neuron, from By LadyofHats - Own work. Image renamed from Image:Complete neuron cell diagram.svg, Public Domain, https://commons.wikimedia.org/w/index.php?curid=3970826.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The first mathematical model of a neuron was proposed by W. McCulloch and W. Pitts after observation of frog neurons [1]. The model has a activation with output equal to 1 or 0. If the inputs connected to the neuron are activated above a certain threshold, then the output of the neuron becomes equal to 1 [2]. The artificial neurons commonly used for machine learning are different from the McCulloch and Pitts model. The artificial neuron has an activation function, weights and bias [3], and the mathematical formulation is equal to:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h=sigma(Wv+b)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where, h is the output, sigma is the activation function, W is the weighting matrix, v is the input vetor, and b the the bias vector.","category":"page"},{"location":"guides/models/blackbox-models-description/#Feedforward-neural-network-(Fnn)","page":"Blackbox models description","title":"Feedforward neural network (Fnn)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The artificial neurons are stacked in deep manner to form the feedforward neural network. A representation of the network with one hidden layer is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: fnn-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"In the special case where the network has one hidden layer, a finite number of neurons and the sigmoid activation function, then the network can approximate any continuous continuous function [4] and it proves to be a universal approximator [5]. The generic mathematical formulation is [6]:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h=mathcalG(v) = g_h¹(v) circ g_h² (h¹) circ  circ g_h^i-1 (h^i-2) circ g_h^i(h^i-1)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where h is the output vector of the neural networks, v is the input vecteur, ron is the hadamard product, g_h^i is the imeme hidden layer with h^i=g_h^i(h^i-1)=sigma^i(W^ih^i-1+b^i) with h^i the output, hi-1 the input, sigma^i the activation function, b^i tha bias, W is the weighting matrice and i is the hidden layer.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Within AutomationLabs, the Fnn input and output layer are implemented without bias and activation fuction. The Fnn can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Input-convex-neural-network-(Icnn)","page":"Blackbox models description","title":"Input convex neural network (Icnn)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Icnn is equivalent of the Fnn. A representation of the network with one hidden layer is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: icnn-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The Icnn is convex compared to Fnn. As a result, weights have to be non negative and the activation function have to be the relu activation function [7]. The mathematical formulation is equivalent to Fnn:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h=mathcalG(v) = g_h¹(v) circ g_h² (h¹) circ  circ g_h^i-1 (h^i-2) circ g_h^i(h^i-1)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where  h is the output, sigmais the activation function, Wis the weighting matrix, vis the input vector and b is the bias. Also, the Icnn has a non negative W matrix and sigma is a relu activation function, such as textrelu=textmax(0x).","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The Icnn is implemented it can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"icnn\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Residual-layer-neural-network-(ResNet)","page":"Blackbox models description","title":"Residual layer neural network (ResNet)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The residual layer networks have been proposed in image recognition to avoid vanishing gradient issues when training deep neural networks with residual value input propagation along the hidden layers [8]. The main feature of the ResNet is a skip connection and addition between each cell [9]:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h=v+ g_h (v)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where h is the output of a hidden layer, v is the input, and g_h is the hidden layer g_h(v)=sigma(Wv+b). The ResNet with one hidden layer can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: resnet-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Furhtermore, ResNet with one layer is derived from forward Euler integration methods [9]:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"yk+1 = yk+ Delta_k g(yk)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where yk+1is the solution at k+1of ordinary differential equation integration and Delta_kis the sample time.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The ResNet is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"resnet\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Poly-inception-neural-network-(PolyNet)","page":"Blackbox models description","title":"Poly-inception neural network (PolyNet)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The poly-inception neural network have been proposed in image as an enhancement of the ResNet [10].  The PolyNet has a skip connection and multiple-path, the mathematical formulation is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h=v+g_h(v)+g_h (g_h(v))= (I + g_h + g_h^2)(v)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where h is the output, v is the input, g_his the hidden layer with g_h(v)=sigma(Wv+b). The PolyNet with one hidden layer can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: polynet-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Furhtermore, PolyNet with one layer is derived from backward Euler integration methods [9]:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"yk+1=yk+Delta_kg(yk+1)  yk+1-Delta_kg(yk+1)=yk yk+1 = (I - Delta_k g)^-1 yk","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where yk+1 is the solution at k+1 of ordinary differential equation integration and Delta_kis the sample time. The link with the backword Euler method needs the following approximation: frac11-x approx sum_n=0^infty x^n, leads to :  (I-Delta_t f)^-1 = I + Delta_t f+ (Delta_t f)^2 +  + (Delta_t f)^n + .","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The PolyNet is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"polynet\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Densely-connected-neural-network-(DenseNet)","page":"Blackbox models description","title":"Densely connected neural network (DenseNet)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The Densely connected neural neural network have been proposed in image recognition as an enhancement of the ResNet [11].  The DenseNet has a concatenation of the previous layers, the mathematical formulation is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"h^l = g_h(textcat(h^1  h^l-1))","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where h is the output, h^iare the previous outputs of the hidden layers, textcatis the contactenation, g_h= sigma(Wv+b). The DenseNet can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: densenet-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The DenseNet is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"names\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"densenet\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#ODE-neural-network-type-1-(NeuralNetODE_type1)","page":"Blackbox models description","title":"ODE neural network type 1 (NeuralNetODE_type1)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Ordinary differential equation neural network (OdeNet) need a numerical ordinary differential equation integration method, rather than to use a discret method. During trainning and infering, the network is discretized with a integration numerical method [12]. The mathematical formulation is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"dot h (t) = g_h(h(t))","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where dot h(t) is the derivative and g_hthe hidden layer such as : g_h = sigma (W v + b). With AutomationLabs there are two implementation of the OdeNet for dynamical system identification. With the first implementation, the odenet is placed between the input and output layers, and it can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: odenet_type1-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The OdeNet is implemented with AutomationLabs for dynamical systems identification. Tt can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"neuralnet_ode_type1\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#ODE-neural-network-type-2-(NeuralNetODE_type2)","page":"Blackbox models description","title":"ODE neural network type 2 (NeuralNetODE_type2)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Ordinary differential equation neural network (OdeNet) need a numerical ordinary differential equation integration method, rather than to use a discret method. During trainning and infering, the network is discretized with a integration numerical method [12]. The mathematical formulation is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"dot h (t) = g_h(h(t))","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where dot h (t) is the derivative and g_h the hidden layer, such as g_h=sigma (W v + b). With AutomationLabs there are two implementationd of the OdeNet for dynamical system identification. With the second implementation, the network input is sent to the odenet, and it can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: odenet_type2-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The OdeNet is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"names\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"neuralnet_ode_type2\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Radial-basis-function-neural-network-(Rbf)","page":"Blackbox models description","title":"Radial basis function neural network (Rbf)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/#Recurrent-neural-network-(Rnn)","page":"Blackbox models description","title":"Recurrent neural network (Rnn)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The neuron with recurrence is the simplest to implement, it presents a modification of an artificial neuron with a return to the previous output [13]. The Rnn allows to take into account the temporal dynamics between data compared to the classical artificial neuron that deals with static data [14]. The mathematical formulation is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"hk = sigma (W vk + U h k-1 + b)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where hk is the output of the Rnn cell at k, sigma is the activation function, Wand Uare the weights matrices, hk-1 is the output of the cell at k-1, and b is the bias. The network with Rnn cell as hidden layer can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: rnn-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The Rnn is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"rnn\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Rnn and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Long-Short-Term-Memory-(Lstm)","page":"Blackbox models description","title":"Long Short-Term Memory (Lstm)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Long short-term memory (LSTM) is a unit with recurrence implementation such as Rnn, and it was first proposed in 1997 [15]. LSTM allows to remedy the difficulty of the vanishing gradient issue to memorise the past inputs/outputs during the training of the Rnn [16]. The mathematical formulation is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"tildec k = texttanh (W_c vk + U_c hk-1 + b_c)   ck = ok    odot ck-1 + ek odot tildec k  hk = sk odot texttanh(ck)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where tildeck is the candidat vector, texttanh is the activation function. vk is the input, U_c W_c b_c are the weights matrices and the bias. ck is the memory vector, ok is the output gate and ek the input gate. hk is the output of the cell with sk the output gate. Also, odot is the Hadamard product. The Lstm's gates are:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"ek = sigma (W_e vk + U_e hk-1 + b_e)  ok = sigma (W_o vk + U_o hk-1 + b_o)  sk = sigma (W_s vk + U_s h k-1 + b_s)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where ek ok sk are the input, forget and output gates. W_e U_e W_o U_o W_s U_s are the weighting matrices and b_e b_o b_s are the bias. The network with Lstm cell as hidden layer can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: lstm-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The Lstm is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"lstm\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tuning and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#Gated-Recurrent-Unit-(Gru)","page":"Blackbox models description","title":"Gated Recurrent Unit (Gru)","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"Gru is recurrent and it has two gates (update gate and reset gate) [17]. The mathematical formulation of Gru is:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"hk = (1-zk) odot hk-1 + zk odot tildehk  tildeh k = texttanh(W_h vk + U_h(rk odot hk-1)) + b_h)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where hk is the hidden state and tildehk is the candidate hidden state. W_h U_h are the weigths matrices, b_h the bias and texttanh the activation function. vk is the input and odot is the Hadamard product. Also, zk is the update gate and rk is the reset gate, such as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"zk = sigma(W_z vk + U_z hk-1 + b_z)  rk = sigma (W_r vk + U_r h k-1 + b_r)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where zk is the update gate, rk the reset gate, sigma is the sigmoid activation function, W_z W_r U_z U_r are the weights matrices, b_z b_r the bias, vk the input, hk-1 the hidden state at k-1. The network with Gru cell as hidden layer can be illustrated as:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"(Image: gru-diagram)","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"The Gru is implemented with AutomationLabs for dynamical systems identification. It can be selected with model_architecture:","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"gru\", \n    )","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tuning and hyperparameters optimization, and model_architecture the mathematical model selected.","category":"page"},{"location":"guides/models/blackbox-models-description/#References","page":"Blackbox models description","title":"References","text":"","category":"section"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[1] McCulloch, W. S., Pitts, W. H., Lettvin, J. Y., & Maturana, H. R. (1959). What the frog’s eye tells the frog’s brain. Proceedings of the IRE, 47(11), 1940-1951.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[2] Chakraverty, S., Sahoo, D. M., & Mahato, N. R. (2019). McCulloch–Pitts neural network model. In Concepts of Soft Computing (pp. 167-173). Springer, Singapore.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[3] LeCun, Y., Bengio, Y., & Hinton, G. (2015). Deep learning. nature, 521(7553), 436-444.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[4] Cybenko, G. (1989). Approximation by superpositions of a sigmoidal function. Mathematics of control, signals and systems, 2(4), 303-314.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[5] Hornik, K. (1991). Approximation capabilities of multilayer feedforward networks. Neural networks, 4(2), 251-257.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[6] Kim, K. K. K., Patrón, E. R., & Braatz, R. D. (2018). Standard representation and unified stability analysis for dynamic artificial neural network models. Neural Networks, 98, 251-262.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[7] Amos, B., Xu, L., & Kolter, J. Z. (2017, July). Input convex neural networks. In International Conference on Machine Learning (pp. 146-155). PMLR.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[8] He, K., Zhang, X., Ren, S., & Sun, J. (2016). Deep residual learning for image recognition. In Proceedings of the IEEE conference on computer vision and pattern recognition (pp. 770-778).","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[9] Blaud, P. C., Chevrel, P., Claveau, F., Haurant, P., & Mouraud, A. (2022). ResNet and PolyNet based identification and (MPC) control of dynamical systems: a promising way. IEEE Access.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[10] Zhang, X., Li, Z., Change Loy, C., & Lin, D. (2017). Polynet: A pursuit of structural diversity in very deep networks. In Proceedings of the IEEE Conference on Computer Vision and Pattern Recognition (pp. 718-726).","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[11] Huang, G., Liu, Z., Van Der Maaten, L., & Weinberger, K. Q. (2017). Densely connected convolutional networks. In Proceedings of the IEEE conference on computer vision and pattern recognition (pp. 4700-4708).","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[12] Chen, R. T., Rubanova, Y., Bettencourt, J., & Duvenaud, D. K. (2018). Neural ordinary differential equations. Advances in neural information processing systems, 31.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[13] Banerjee, K., Georganas, E., Kalamkar, D. D., Ziv, B., Segal, E., Anderson, C., & Heinecke, A. (2019). Optimizing deep learning rnn topologies on intel architecture. Supercomputing Frontiers and Innovations, 6(3), 64-85.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[14] Schuster, M., & Paliwal, K. K. (1997). Bidirectional recurrent neural networks. IEEE transactions on Signal Processing, 45(11), 2673-2681.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[15] Hochreiter, S., & Schmidhuber, J. (1997). Long short-term memory. Neural computation, 9(8), 1735-1780.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[16] Greff, K., Srivastava, R. K., Koutník, J., Steunebrink, B. R., & Schmidhuber, J. (2016). LSTM: A search space odyssey. IEEE transactions on neural networks and learning systems, 28(10), 2222-2232.","category":"page"},{"location":"guides/models/blackbox-models-description/","page":"Blackbox models description","title":"Blackbox models description","text":"[17] Dey, R., & Salem, F. M. (2017, August). Gate-variants of gated recurrent unit (GRU) neural networks. In 2017 IEEE 60th international midwest symposium on circuits and systems (MWSCAS) (pp. 1597-1600). IEEE.","category":"page"},{"location":"guides/models/blackbox-models-description/#","page":"Blackbox models description","title":"","text":"","category":"section"},{"location":"guides/introduction/#Introduction-guides","page":"Introduction guides","title":"Introduction guides","text":"","category":"section"},{"location":"guides/introduction/","page":"Introduction guides","title":"Introduction guides","text":"In this section, you will find detailed information on how AutomationLabs works, including commands and settings.","category":"page"},{"location":"guides/introduction/#Summary","page":"Introduction guides","title":"Summary","text":"","category":"section"},{"location":"guides/introduction/","page":"Introduction guides","title":"Introduction guides","text":"Interact with projects\nInteract with data\nInteract with models\nInteract with controllers","category":"page"},{"location":"guides/controllers/administrate-controllers/#Interact-with-controllers","page":"Interact with controllers","title":"Interact with controllers","text":"","category":"section"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"You can interact with the controller to tune a Model Predictive Control from a model for dynamical system control. In addition, a large number of parameters are available to select the suitable controller to be tuned and the optimization algorithm.","category":"page"},{"location":"guides/controllers/administrate-controllers/#Tune-a-controller","page":"Interact with controllers","title":"Tune a controller","text":"","category":"section"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"To tune a controller from a model, you can use the command :tune:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"julia> c = controller(:tune; \n                project_name = \"project_1\",\n                model_name = \"model_1\",\n                controller_name = \"controller_1\",\n                mpc_controller_type = \"model_predictive_control\",\n                mpc_programming_type = \"linear\",\n                mpc_lower_state_constraints = mpc_lower_state_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,       \n         )    ","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"where project_name is the name of the project, model_name is the model name which will be used for the controller, controller_name is the name of the saved controller on the database, mpc_controller_type is the controller, mpc_programming_type is the method of implementation of the model predictive control, mpc_***_constraints are the state and the input constraints of the controller,mpc_horizon is the horizon length of the controller, mpc_sample_time is the time sample, mpcstatereference is the state reference for the controller and mpc_input_reference  is the  input reference for the controller.","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"The mpc_controller_type can be a model predictive control or a economic predictive control. More information can be read on the following pages:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"Model predictive control","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"Economic model predictive control","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"Furthermore, the solvers available when tuning a controller are depicted in solvers section:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"Solvers for model predictive control","category":"page"},{"location":"guides/controllers/administrate-controllers/#Calculate-a-controller","page":"Interact with controllers","title":"Calculate a controller","text":"","category":"section"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"You can calculate or compute a controller:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"julia> initialization = [0.6, 0.6, 0.6, 0.6]\njulia> c = controller(:calculate; \n                       initialization =  initialization, \n                       predictive_controller = c\n     )","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"where initialization is the state initialization or measure and predictive_controller is the controller to calculate.","category":"page"},{"location":"guides/controllers/administrate-controllers/#List-controllers","page":"Interact with controllers","title":"List controllers","text":"","category":"section"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"You can list the controllers from a project:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"julia> controller(:ls, project_name = \"project_1\")","category":"page"},{"location":"guides/controllers/administrate-controllers/#Remove-a-controller","page":"Interact with controllers","title":"Remove a controller","text":"","category":"section"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"You can remove a controller from a project:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"julia> controller(:rm, project_name = \"project_1\", controller_name = \"name\")","category":"page"},{"location":"guides/controllers/administrate-controllers/#Load-a-controller","page":"Interact with controllers","title":"Load a controller","text":"","category":"section"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"You can load a controller from the database:","category":"page"},{"location":"guides/controllers/administrate-controllers/","page":"Interact with controllers","title":"Interact with controllers","text":"julia> controller(:load, project_name = \"project1\", controller_name = \"controller1\")","category":"page"},{"location":"guides/models/hyperparameters-optimization/#Hyperparameters-optimization","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"","category":"section"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"The hyperparameters include the parameters of the neural network. The hyperparameters considered are: the number of neurons, the number of layers, the activation function, the batch size, the number of epochs, the optimizer used. They have an influence on the learning time of the network and the final performance of the model [1]. Get a good hyperparameters before learning is tricky if not impossible, as well as testing all the possibilities. So, the hyperparameters can be optimized with a cost function, such as:","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"A selection of hyperparameters is performed;\nA neural network with the hyperparameters obtained in the previous step is trained;\nThe network is trained;\nWhen the training is completed, the performance of the network is evaluated with the dataset;","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"At the beginning, the hyperparameters are chosen arbitrarily. Then as the iterations progress, their influence on the model performance of the black box model is taken into account and the cost function is reduced. The optimization problem with the hyperparameters of the neural network is non-convex and non-derivable and the use of metaheuristic algorithms is required [1]. When tuning a model, the hyperparameters range value can be configured, such as:","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n        neuralnet_minimum_epochs = 500,\n        neuralnet_maximum_epochs = 1000,\n    )","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"where project_name the name of the related project, model_name the name of the model when saving on the database, io the name of input-output data, computation_solver the solver selected, computation_maximum_time the maximum time of the tune with Fnn and hyperparameters optimization, and model_architecture the mathematical model selected. Furthermore, the epochs hyperparameter range value are chosen with neuralnet_minimum_epochs and neuralnet_maximum_epochs, as a result the algorithm can choose epochs from 500 to 1000. The hyperparameters which can be modified are:","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"neuralnet_minimum_epochs;\nneuralnet_maximum_epochs;\nneuralnet_minimum_layers;\nneuralnet_minimum_neuron;\nneuralnet_maximum_neuron;","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"Moreover, note that the model need to be iterable, for instance, the Fnn or ResNet. More hyperparameters information is readable on Parameters section:","category":"page"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"Parameters models","category":"page"},{"location":"guides/models/hyperparameters-optimization/#Reference","page":"Hyperparameters optimization","title":"Reference","text":"","category":"section"},{"location":"guides/models/hyperparameters-optimization/","page":"Hyperparameters optimization","title":"Hyperparameters optimization","text":"[1] Blaud, P. (2022). Pilotage distribué de systèmes multi-énergies en réseau (Doctoral dissertation, Ecole nationale supérieure Mines-Télécom Atlantique).","category":"page"},{"location":"guides/models/parameters/#Parameters-models","page":"Parameters","title":"Parameters models","text":"","category":"section"},{"location":"guides/models/parameters/#:tune","page":"Parameters","title":":tune","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Tune a model from io data.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: model\nExample: model(:tune, project_name = \"project\", model_name = \"model\")","category":"page"},{"location":"guides/models/parameters/#Mandatory-parameters","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"The following parameters are mandatory in order to tune a model from input-output data.","category":"page"},{"location":"guides/models/parameters/#project_name","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the tuning machine. After computation the model will be saved in this project","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:tune, ...)\nExample: model(:tune, project_name = \"project\")","category":"page"},{"location":"guides/models/parameters/#io","page":"Parameters","title":"io","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the input-output data for tuning a model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:tune, ...)\nExample: model(:tune, io = \"io_name\")","category":"page"},{"location":"guides/models/parameters/#Optional-parameters","page":"Parameters","title":"Optional parameters","text":"","category":"section"},{"location":"guides/models/parameters/#Model-parameters","page":"Parameters","title":"Model parameters","text":"","category":"section"},{"location":"guides/models/parameters/#model_architecture","page":"Parameters","title":"model_architecture","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set architecture of the tuning model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: fnn\nAccepted: string: linear, fnn, rbf, icnn, resnet, polynet, densenet, neuralnetodetype1, neuralnetodetype2, rnn, lstm, gru\nMethod argument: model(:tune, ...)\nExample: model(:tune, model_architecture = \"resnet\")","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Please note that some architure allow iterative algorithms and hyperparameters are optimised, such as:","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Architecture Iterative\nlinear [ ]\nfnn [x]\nrbf [x]\nicnn [x]\nresnet [x]\npolynet [x]\ndensenet [x]\nneuralnetodetype1 [x]\nneulranetodetype2 [x]\nrnn [x]\nlstm [x]\ngru [x]\nexploration_models [x]","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"where, [ ] not iterative and [x] iterative.","category":"page"},{"location":"guides/models/parameters/#model_exploration","page":"Parameters","title":"model_exploration","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the model exploration.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: [\"fnn\", \"rbf\", \"icnn\", \"resnet\", \"polynet\", \"densenet\"]\nAccepted: vector of string: [\"fnn\", \"rbf\", \"icnn\", \"resnet\", \"polynet\", \"densenet\", \"neuralnetodetype1\", \"neulranetodetype2\", \"rnn\", \"lstm\", \"gru\"]\nMethod argument: model(:tune, ...)\nExample: model(:tune, model_exploration = [\"fnn\", \"resnet\"])","category":"page"},{"location":"guides/models/parameters/#model_sample_time","page":"Parameters","title":"model_sample_time","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the model sample time of the neulranetodetype2.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 1.0 second\nAccepted: Float\nMethod argument: model(:tune, ...)\nExample: model(:tune, model_sample_time = 5.0)","category":"page"},{"location":"guides/models/parameters/#Computation-parameters","page":"Parameters","title":"Computation parameters","text":"","category":"section"},{"location":"guides/models/parameters/#computation_maximum_time","page":"Parameters","title":"computation_maximum_time","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the training time of the model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 15 minutes\nAccepted: Dates\nMethod argument: model(:tune, ...)\nExample: model(:tune, maximum_time = Dates.Minute(5))","category":"page"},{"location":"guides/models/parameters/#computation_solver","page":"Parameters","title":"computation_solver","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the solver for tuning model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: adam\nAccepted: string, adam, radam, oadam, nadam, lbfgs, oaccel, pso, lls\nMethod argument: model(:tune, ...)\nExample: model(:tune, method_solver = \"lbfgs\")","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Please note that some solvers are specific to model, such as:","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Architecture adam radam oadam nadam lbfgs oaccel pso lls\nlinear [ ] [ ] [ ] [ ] [ ] [ ] [ ] [X]\nfnn [x] [x] [x] [x] [x] [x] [x] [ ]\nrbf [x] [x] [x] [x] [x] [x] [x] [ ]\nicnn [x] [x] [x] [x] [x] [x] [x] [ ]\nresnet [x] [x] [x] [x] [x] [x] [x] [ ]\npolynet [x] [x] [x] [x] [x] [x] [x] [ ]\ndensenet [x] [x] [x] [x] [x] [x] [x] [ ]\nneuralnet_ode_type1 [x] [x] [x] [x] [x] [x] [x] [ ]\nneuralnet_ode_type2 [x] [x] [x] [x] [x] [x] [x] [ ]\nrnn [x] [x] [x] [x] [x] [x] [x] [ ]\nlstm [x] [x] [x] [x] [x] [x] [x] [ ]\ngru [x] [x] [x] [x] [x] [x] [x] [ ]","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"where, [ ] depicts no supported solvers and [x] depicts supported solvers.","category":"page"},{"location":"guides/models/parameters/#computation_processor","page":"Parameters","title":"computation_processor","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the processor used during computation.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: cpu_1\nAccepted: String, cpu1, cputhreads, cpu_processes\nMethod argument: model(:tune, ...)\nExample: model(:tune, computation_processor = \"cpu_threads\")","category":"page"},{"location":"guides/models/parameters/#computation_verbosity","page":"Parameters","title":"computation_verbosity","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Set the therminal verbosity during computation.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 0\nAccepted: 0 (no information), 1 (fragmented information) or greather than 1 (full information)\nMethod argument: model(:tune, ...)\nExample: model(:tune, computation_verbosity = 5)","category":"page"},{"location":"guides/models/parameters/#Neural-networks-parameters","page":"Parameters","title":"Neural networks parameters","text":"","category":"section"},{"location":"guides/models/parameters/#neuralnet_activation_function","page":"Parameters","title":"neuralnet_activation_function","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Activation function for neural networks.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: relu\nAccepted: String: relu, sigmoid, swish, tanh\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_activation_function = \"relu\")","category":"page"},{"location":"guides/models/parameters/#neuralnet_minimum_epochs","page":"Parameters","title":"neuralnet_minimum_epochs","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Minimum epochs hyperparameter value.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 50\nAccepted: integer and lower than neuralnet_maximum_epochs\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_minimum_epochs = 50)","category":"page"},{"location":"guides/models/parameters/#neuralnet_maximum_epochs","page":"Parameters","title":"neuralnet_maximum_epochs","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Maximum epochs hyperparameter value.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 500\nAccepted: integer and higher than neuralnet_minimum_epochs\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_maximum_epochs = 500)","category":"page"},{"location":"guides/models/parameters/#neuralnet_minimum_layers","page":"Parameters","title":"neuralnet_minimum_layers","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Minimum hidden layers hyperparameter value.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 1\nAccepted: integer and lower than neuralnet_maximum_layers\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_minimum_layers = 1)","category":"page"},{"location":"guides/models/parameters/#neuralnet_maximum_layers","page":"Parameters","title":"neuralnet_maximum_layers","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Maximum hidden layers hyperparameter value.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 6\nAccepted: integer and higher than neuralnet_minimum_layers\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_minimum_layers = 6)","category":"page"},{"location":"guides/models/parameters/#neuralnet_minimum_neuron","page":"Parameters","title":"neuralnet_minimum_neuron","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Minimum neuron hyperparameter value.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 3\nAccepted: integer and lower than neuralnet_maximum_neuron\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_minimum_layers = 3)","category":"page"},{"location":"guides/models/parameters/#neuralnet_maximum_neuron","page":"Parameters","title":"neuralnet_maximum_neuron","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Maximum neuron hyperparameter value.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 10\nAccepted: integer higher than neuralnet_minimum_neuron\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_maximum_neuron = 10)","category":"page"},{"location":"guides/models/parameters/#neuralnet_batch_size","page":"Parameters","title":"neuralnet_batch_size","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Batch size value when training neural network.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 512\nAccepted: 128, 256, 512, 1024, 2048\nMethod argument: model(:tune, ...)\nExample: model(:tune, neuralnet_batch_size = 512)","category":"page"},{"location":"guides/models/parameters/#:ls","page":"Parameters","title":":ls","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"List the models that are available for a project.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: model\nExample: model(:ls; project_name = \"...\")","category":"page"},{"location":"guides/models/parameters/#Mandatory-parameters-2","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"The following parameters are mandatories in order to list model from a project.","category":"page"},{"location":"guides/models/parameters/#project_name-2","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Project name to list model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:ls, ...)\nExample: model(:ls, project_name = \"project#1\")","category":"page"},{"location":"guides/models/parameters/#:rm","page":"Parameters","title":":rm","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Remove model for a project.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: model\nExample: model(:rm, project_name = \"...\", name = \"...\")","category":"page"},{"location":"guides/models/parameters/#Mandatory-parameters-3","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"The following parameters are mandatories in order to delete model from a project.","category":"page"},{"location":"guides/models/parameters/#project_name-3","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Project name of the model to delete.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:rm, ...)\nExample: model(:rm, project_name = \"project1\")","category":"page"},{"location":"guides/models/parameters/#model_name","page":"Parameters","title":"model_name","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Name of the model to delete.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:rm, ...)\nExample: model(:rm, model_name = \"model1\")","category":"page"},{"location":"guides/models/parameters/#:stats","page":"Parameters","title":":stats","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Presents information about the tuning model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: model\nExample: model(:stats, project_name = \"...\", model_name = \"...\")","category":"page"},{"location":"guides/models/parameters/#Mandatory-parameters-4","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"The following parameters are mandatories in order to provide information about the tuning model from a project.","category":"page"},{"location":"guides/models/parameters/#project_name-4","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Project name of the model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:stats, ...)\nExample: model(:stats, project_name = \"project1\")","category":"page"},{"location":"guides/models/parameters/#model_name-2","page":"Parameters","title":"model_name","text":"","category":"section"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Name of the model.","category":"page"},{"location":"guides/models/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: model(:stats, ...)\nExample: model(:stats, model_name = \"model1\")","category":"page"},{"location":"guides/models/loss-function/#Loss-function","page":"Loss functions","title":"Loss function","text":"","category":"section"},{"location":"guides/models/loss-function/","page":"Loss functions","title":"Loss functions","text":"The loss function implemented is the Mean Absolute Error (MAE) [1]:","category":"page"},{"location":"guides/models/loss-function/","page":"Loss functions","title":"Loss functions","text":"MAE = frac1N_b sum_n=1^ N_b x_n - hatx _n","category":"page"},{"location":"guides/models/loss-function/","page":"Loss functions","title":"Loss functions","text":"where,N_b is the total number of samples, x is the tageted sample and hatx is the output of the model.","category":"page"},{"location":"guides/models/loss-function/#Reference","page":"Loss functions","title":"Reference","text":"","category":"section"},{"location":"guides/models/loss-function/","page":"Loss functions","title":"Loss functions","text":"[1] Blaud, P. (2022). Pilotage distribué de systèmes multi-énergies en réseau (Doctoral dissertation, Ecole nationale supérieure Mines-Télécom Atlantique).","category":"page"},{"location":"installation/installation/#Installation-with-Julia","page":"Installation with Julia","title":"Installation with Julia","text":"","category":"section"},{"location":"installation/installation/","page":"Installation with Julia","title":"Installation with Julia","text":"You can install AutomationLabs with:","category":"page"},{"location":"installation/installation/","page":"Installation with Julia","title":"Installation with Julia","text":"julia> import Pkg\njulia> Pkg.add(\"AutomationLabs\")","category":"page"},{"location":"installation/installation/","page":"Installation with Julia","title":"Installation with Julia","text":"Then, you can use the package with:","category":"page"},{"location":"installation/installation/","page":"Installation with Julia","title":"Installation with Julia","text":"julia> using AutomationLabs","category":"page"},{"location":"guides/controllers/economic-model-predictive-control/#Economic-model-predictive-control","page":"Economic model predictive control","title":"Economic model predictive control","text":"","category":"section"},{"location":"quick_start/introductory/#Introduction-quick-start","page":"Introduction","title":"Introduction quick start","text":"","category":"section"},{"location":"quick_start/introductory/","page":"Introduction","title":"Introduction","text":"(Image: lecture)","category":"page"},{"location":"quick_start/introductory/#What-is-AutomationLabs?","page":"Introduction","title":"What is AutomationLabs?","text":"","category":"section"},{"location":"quick_start/introductory/","page":"Introduction","title":"Introduction","text":"AutomationLabs is a low-code solution that provides the automation engineer with the necessary tools and algorithms. Such as store dynamical system data, plot data, dynamical system identification, tune optimal controllers based on Model Predictive Control.","category":"page"},{"location":"quick_start/introductory/#What-does-it-contain?","page":"Introduction","title":"What does it contain?","text":"","category":"section"},{"location":"quick_start/introductory/","page":"Introduction","title":"Introduction","text":"AutomationLabs gives you advanced tools and algorithms and database to keep your valuable data, a large choice of models to efficiently model your dynamical systems, and also the possibility to model dynamical systems with physical equations. In addition, a number of models are based on artificial intelligence, allowing you to get powerful models. Moreover, we know that the difficulty does not lie in the models but in the algorithms and learning methods to properly parameterize these models. To do so, it offers the use of different optimization and learning algorithms. Thus, performance comparison is facilitated. In summary, it contains:","category":"page"},{"location":"quick_start/introductory/","page":"Introduction","title":"Introduction","text":"Store, manage and plot data.\nTune blackbox or greybox models for dynamical system identification.\nA large choice of models and optimization.\nTune a Model Predictive Control.","category":"page"},{"location":"quick_start/introductory/#Why-to-use-it?","page":"Introduction","title":"Why to use it?","text":"","category":"section"},{"location":"quick_start/introductory/","page":"Introduction","title":"Introduction","text":"AutomationLabs allows you to reduce engineering time, save time, and evaluate different models and control with a reduced code solution. In addition, the open-source solution prevents vendor lock-in and an easy-to-use api.","category":"page"},{"location":"quick_start/introductory/#Quick-start-summary","page":"Introduction","title":"Quick start summary","text":"","category":"section"},{"location":"quick_start/introductory/","page":"Introduction","title":"Introduction","text":"Manage your first data\nTune your first model\nTune your first controller","category":"page"},{"location":"collaboration/how-to-contribute/#How-to-contribute","page":"How to contribute","title":"How to contribute","text":"","category":"section"},{"location":"collaboration/how-to-contribute/#Starring-and-citing","page":"How to contribute","title":"Starring and citing","text":"","category":"section"},{"location":"collaboration/how-to-contribute/","page":"How to contribute","title":"How to contribute","text":"If you use AutomationLabs in your work, please consider starring and citing.","category":"page"},{"location":"collaboration/how-to-contribute/#Supporting","page":"How to contribute","title":"Supporting","text":"","category":"section"},{"location":"collaboration/how-to-contribute/","page":"How to contribute","title":"How to contribute","text":"If you like the work on AutomationLabs and want to support future development, please consider supporting.","category":"page"},{"location":"collaboration/how-to-contribute/#Bug-reports","page":"How to contribute","title":"Bug reports","text":"","category":"section"},{"location":"collaboration/how-to-contribute/","page":"How to contribute","title":"How to contribute","text":"Please report issues with the Github issue tracker. All types of issues are welcome and encouraged, such as bug reports, documentation typos, feature requests or example requests.","category":"page"},{"location":"collaboration/how-to-contribute/#Use-cases","page":"How to contribute","title":"Use cases","text":"","category":"section"},{"location":"collaboration/how-to-contribute/","page":"How to contribute","title":"How to contribute","text":"We are looking for case studies, such as dynamical system identification or control, please notify us of an appropriate use case.","category":"page"},{"location":"guides/data/parameters/#Parameters","page":"Parameters","title":"Parameters","text":"","category":"section"},{"location":"guides/data/parameters/#:add","page":"Parameters","title":":add","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Add data for dynamical system identification.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: data\nExample: data(:add)","category":"page"},{"location":"guides/data/parameters/#Mandatory-parameters","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/data/parameters/#path","page":"Parameters","title":"path","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set path on local disk of the data to add.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:add, ...)\nExample: data(:add, path = \"/home/...\")","category":"page"},{"location":"guides/data/parameters/#project_name","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the data to add.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:add, ...)\nExample: data(:add, project_name = \"name\")","category":"page"},{"location":"guides/data/parameters/#name","page":"Parameters","title":"name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set the name of the data to add.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:add, ...)\nExample: data(:add, name = \"name\")","category":"page"},{"location":"guides/data/parameters/#:io","page":"Parameters","title":":io","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set a input output data pair for model identification.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: data\nExample: data(:io, ...)","category":"page"},{"location":"guides/data/parameters/#Mandatory-parameters-2","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/data/parameters/#inputs_data_name","page":"Parameters","title":"inputs_data_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set the raw input data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:io, ...)\nExample: data(:io, inputs_data_name = \"raw_input\")","category":"page"},{"location":"guides/data/parameters/#outputs_data_name","page":"Parameters","title":"outputs_data_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set the raw output data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:io, ...)\nExample: data(:io, outputs_data_name = \"raw_output\")","category":"page"},{"location":"guides/data/parameters/#project_name-2","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set project to create the io data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:io, ...)\nExample: data(:io, project_name = \"project\")","category":"page"},{"location":"guides/data/parameters/#data_name","page":"Parameters","title":"data_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set the iodata to be referenced by the database and the filepath.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:io, ...)\nExample: data(:io, data_name = \"io_data\")","category":"page"},{"location":"guides/data/parameters/#Optional-parameters","page":"Parameters","title":"Optional parameters","text":"","category":"section"},{"location":"guides/data/parameters/#n_delay","page":"Parameters","title":"n_delay","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set delay for deep time delay.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: 1\nAccepted: Integer\nMethod argument: data(:io, ...)\nExample: data(:io, n_delay = 1)","category":"page"},{"location":"guides/data/parameters/#**n_sequence**","page":"Parameters","title":"n_sequence","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set the required sequence length for a recurrent neural networks model. The n_sequence is a suite of samples.&#x20;","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: Integer\nMethod argument: data(:io, ...)\nExample: data(:io, n_sequence = 64)","category":"page"},{"location":"guides/data/parameters/#normalisation","page":"Parameters","title":"normalisation","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set data normalisation for data from 0 to 1.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: false\nAccepted: Boolean\nMethod argument: data(:io, ...)\nExample: data(:io, normalisation = false)","category":"page"},{"location":"guides/data/parameters/#data_lower_input","page":"Parameters","title":"data_lower_input","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set a lower limit on input data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: [-Inf]\nAccepted: vector\nMethod argument: data(:io, ...)\nExample: data(:io, data_lower_input = [0.2])","category":"page"},{"location":"guides/data/parameters/#data_upper_input","page":"Parameters","title":"data_upper_input","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set a upper limit on input data","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: [Inf]\nAccepted: vector\nMethod argument: data(:io, ...)\nExample: data(:io, data_upper_limit = [1.2])","category":"page"},{"location":"guides/data/parameters/#data_lower_output","page":"Parameters","title":"data_lower_output","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set a lower limit on output data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: [-Inf]\nAccepted: Vector\nMethod argument: data(:io, ...)\nExample: data(:io, data_lower_output = [0.2])","category":"page"},{"location":"guides/data/parameters/#data_upper_output","page":"Parameters","title":"data_upper_output","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set a upper limit on output data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: [Inf]\nAccepted: Vector\nMethod argument: data(:io, ...)\nExample: data(:io, data_upper_limit = [1.2])","category":"page"},{"location":"guides/data/parameters/#data_type","page":"Parameters","title":"data_type","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set type on data.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: Float64\nAccepted: Float32 or Float64\nMethod argument: data(:io, ...)\nExample: data(:io, data_type = Float64)","category":"page"},{"location":"guides/data/parameters/#:ls","page":"Parameters","title":":ls","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"List the data that are available.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: data\nExample: data(:ls; project_name = \"...\")","category":"page"},{"location":"guides/data/parameters/#Mandatory-parameters-3","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/data/parameters/#project_name-3","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the data to list.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:ls, ...)\nExample: data(:ls, project_name = \"name\")","category":"page"},{"location":"guides/data/parameters/#:rm","page":"Parameters","title":":rm","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Remove data from a project.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: data\nExample: data(:rm, project_name = \"name\")","category":"page"},{"location":"guides/data/parameters/#Mandatory-parameters-4","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/data/parameters/#project_name-4","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the data to delete.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:rm, ...)\nExample: data(:rm, project_name = \"name\")","category":"page"},{"location":"guides/data/parameters/#name-2","page":"Parameters","title":"name","text":"","category":"section"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Set name of the data to delete.","category":"page"},{"location":"guides/data/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: data(:rm, ...)\nExample: data(:rm, name = \"name\")","category":"page"},{"location":"guides/controllers/model-predictive-control/#Model-predictive-control","page":"Model predictive control","title":"Model predictive control","text":"","category":"section"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"The Model Predictive Control (MPC) is an advanced control method, which is able to control multi-inputs and multi-output systems. It uses an internal model of the process to be controlled, enabling it to predict its behavior over a certain horizon length, and to optimize its control inputs on this basis. The implementation of an MPC control involves the real-time resolution of an optimization problem on the basis of a criterion defining the control objectives, such as setpoint tracking. The foundation of this control method is attributed to J. Richalet, in 1978 [1].","category":"page"},{"location":"guides/controllers/model-predictive-control/#Formulation","page":"Model predictive control","title":"Formulation","text":"","category":"section"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"The model predictive control formulation envolves a quadratic cost function with constraints [2], such as:","category":"page"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"textmin sum_i=1^N tildex_i^TQ tildex_i + tildeu_i^T R tildeu_i","category":"page"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"textsubject to  hatx_i+1 = f(hatx_i u_i)  tildex_i = hatx_i -  x_i^r  tildeu_i = u_i - u_i^r  hatx_0 =  barx(t_k)  x_min leq hatx_i leq x_max  u_min leq u_i leq u_max","category":"page"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"where hatx is the state prediction according the model of the dynamical system, uis the input control, tildex is the state deviation from the state reference, tildeu is the input control deviation from the input control reference, barx is the state initialization, x_min and x_max is the state constraints and umin and umax is the input control constraints.","category":"page"},{"location":"guides/controllers/model-predictive-control/#Terminal-ingredients","page":"Model predictive control","title":"Terminal ingredients","text":"","category":"section"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"For the moment, the terminal ingredients cannot be added.","category":"page"},{"location":"guides/controllers/model-predictive-control/#References","page":"Model predictive control","title":"References","text":"","category":"section"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"[1] Richalet, J., Rault, A., Testud, J. L., & Papon, J. (1978). Model predictive heuristic control: Applications to industrial processes. Automatica, 14(5), 413-428.","category":"page"},{"location":"guides/controllers/model-predictive-control/","page":"Model predictive control","title":"Model predictive control","text":"[2] Mayne, D. Q., Rawlings, J. B., Rao, C. V., & Scokaert, P. O. (2000). Constrained model predictive control: Stability and optimality. Automatica, 36(6), 789-814.","category":"page"},{"location":"guides/models/exploration-of-models/#Exploration-of-models","page":"Exploration of models","title":"Exploration of models","text":"","category":"section"},{"location":"guides/models/exploration-of-models/","page":"Exploration of models","title":"Exploration of models","text":"It is possible to use the meta-heuristic algorithm to evaluate the models and optimise the type of model that reduces the cost function with model_architecture and model_exploration parameters, such as:","category":"page"},{"location":"guides/models/exploration-of-models/","page":"Exploration of models","title":"Exploration of models","text":"julia> model(:tune; \n        project_name = \"name\",\n        model_name = \"model\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"exploration_models\",\n        model_exploration = [\"fnn\", \"resnet\"],\n    )","category":"page"},{"location":"guides/models/exploration-of-models/","page":"Exploration of models","title":"Exploration of models","text":"where project_name is the name of the related project, model_name is the name of the model when saving on the database, io is the name of input-output data, computation_solver is the solver selected, and model_architecture is the mathematical model with exploration and model_exploration indicates to the meta-heuristic algorithm the models to be evaluated.","category":"page"},{"location":"guides/models/exploration-of-models/","page":"Exploration of models","title":"Exploration of models","text":"Moreover, the models need to be iterable, for instance, Fnn or ResNet. More  information is readable on Parameters section:","category":"page"},{"location":"guides/models/exploration-of-models/","page":"Exploration of models","title":"Exploration of models","text":"Parameters models","category":"page"},{"location":"guides/controllers/solvers/#Solvers-for-model-predictive-control","page":"Solvers","title":"Solvers for model predictive control","text":"","category":"section"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"The solvers available to calculate a controller and the solver selection depends on whether the controller is linear, non-linear or linear with integer numbers. If you do not specify a solver, it will automatically assign the appropriate solver.","category":"page"},{"location":"guides/controllers/solvers/#Solver-for-linear-controller","page":"Solvers","title":"Solver for linear controller","text":"","category":"section"},{"location":"guides/controllers/solvers/#Operator-splitting-solver-for-quadratic-program-(OSQP)","page":"Solvers","title":"Operator splitting solver for quadratic program (OSQP)","text":"","category":"section"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"OSQP can solve the linear model predictive control. In order to use OSQP solver, the parameter mpc_solver must be filled in, such as:","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"julia> c = controller(:tune; \n                project_name = \"QTP_test\",\n                model_name = \"model_qtp_nonlinear\",\n                controller_name = \"linear_controller\",\n                mpc_controller_type = \"model_preditive_control\",\n                mpc_programming_type = \"linear\",\n                mpc_lower_state_constraints = mpc_lower_statie_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,   \n                mpc_solver = \"osqp\",\n            ) ","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"where project_name is the related project, model_name is the name used for tuning the controller, mpc_controller_type is the related control, mpc programming_type is the implementation method, mpc_lower_state_constraints is the state constraints, mpc_higher_sate_constraints is the state constraints, mpc_lower_input_constraints is the input control constraints, mpc_higher_input_constraints is the input control constraints, mpc_horizon is the horizon length, mpc_sample_time is the time between two samples, mpc_state_reference is the state reference,  mpc_input_reference is the input reference related to the model predictive control and mpc_solver is the parameter for solver selection.","category":"page"},{"location":"guides/controllers/solvers/#Solver-for-non-linear-controller","page":"Solvers","title":"Solver for non linear controller","text":"","category":"section"},{"location":"guides/controllers/solvers/#interior-point-(Ipopt)","page":"Solvers","title":"interior-point  (Ipopt)","text":"","category":"section"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"Ipopt can solve the non linear model predictive control. In order to use Ipopt solver, the parameter mpc_solver must be filled in, such as:","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"julia> c = controller(:tune; \n                project_name = \"QTP_test\",\n                model_name = \"model_qtp_nonlinear\",\n                controller_name = \"linear_controller\",\n                mpc_controller_type = \"model_predictive_control\",\n                mpc_programming_type = \"non_linear\",\n                mpc_lower_state_constraints = mpc_lower_statie_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,   \n                mpc_solver = \"ipopt\",\n            ) ","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"where project_name is the related project, model_name is the name used for tuning the controller, mpc_controller_type is the related control, mpc programming_type is the implementation method, mpc_lower_state_constraints is the state constraints, mpc_higher_sate_constraints is the state constraints, mpc_lower_input_constraints is the input control constraints, mpc_higher_input_constraints is the input control constraints, mpc_horizon is the horizon length, mpc_sample_time is the time between two samples, mpc_state_reference is the state reference,  mpc_input_reference is the input reference related to the model predictive control and mpc_solver is the parameter for solver selection.","category":"page"},{"location":"guides/controllers/solvers/#Solver-for-mixed-integer-linear-controller","page":"Solvers","title":"Solver for mixed integer linear controller","text":"","category":"section"},{"location":"guides/controllers/solvers/#Solving-Integer-programs-and-constraint-programs-(SCIP)","page":"Solvers","title":"Solving Integer programs and constraint programs (SCIP)","text":"","category":"section"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"SCIP can solve the non linear model predictive control. In order to use SCIP solver, the parameter mpc_solver must be filled in, such as:","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"julia> c = controller(:tune; \n                project_name = \"QTP_test\",\n                model_name = \"model_qtp_nonlinear\",\n                controller_name = \"linear_controller\",\n                mpc_controller_type = \"model_predictive_control\",\n                mpc_programming_type = \"mixed_linear\",\n                mpc_lower_state_constraints = mpc_lower_statie_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,   \n                mpc_solver = \"scip\",\n            ) ","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"where project_name is the related project, model_name is the name used for tuning the controller, mpc_controller_type is the related control, mpc programming_type is the implementation method, mpc_lower_state_constraints is the state constraints, mpc_higher_sate_constraints is the state constraints, mpc_lower_input_constraints is the input control constraints, mpc_higher_input_constraints is the input control constraints, mpc_horizon is the horizon length, mpc_sample_time is the time between two samples, mpc_state_reference is the state reference,  mpc_input_reference is the input reference related to the model predictive control and mpc_solver is the parameter for solver selection.","category":"page"},{"location":"guides/controllers/solvers/#References","page":"Solvers","title":"References","text":"","category":"section"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"[1] Stellato, B., Banjac, G., Goulart, P., Bemporad, A., & Boyd, S. (2020). OSQP: An operator splitting solver for quadratic programs. Mathematical Programming Computation, 12(4), 637-672.","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"[2] Wächter, A., & Biegler, L. T. (2006). On the implementation of an interior-point filter line-search algorithm for large-scale nonlinear programming. Mathematical programming, 106(1), 25-57.","category":"page"},{"location":"guides/controllers/solvers/","page":"Solvers","title":"Solvers","text":"[3] Vigerske, S., & Gleixner, A. (2018). SCIP: Global optimization of mixed-integer nonlinear programs in a branch-and-cut framework. Optimization Methods and Software, 33(3), 563-593.","category":"page"},{"location":"guides/projects/administrate-projects/#Interact-with-projects","page":"Interact with projects","title":"Interact with projects","text":"","category":"section"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"The project is the first step to work on, it will separate on different projects the raw data, the io data the models, the controllers, the dashboard and the exports. You can create as many projects as necessary.","category":"page"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"(Image: image-project-ls)","category":"page"},{"location":"guides/projects/administrate-projects/#Create-a-new-project","page":"Interact with projects","title":"Create a new project","text":"","category":"section"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"You can create a new project:","category":"page"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"julia> using AutomationPod\njulia> project(:create, name = \"first_project\")","category":"page"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"If the project name is not filled in, a random name will be provided.","category":"page"},{"location":"guides/projects/administrate-projects/#List-the-projects","page":"Interact with projects","title":"List the projects","text":"","category":"section"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"You can list the whole projects:","category":"page"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"julia> project(:ls)","category":"page"},{"location":"guides/projects/administrate-projects/#Remove-a-project","page":"Interact with projects","title":"Remove a project","text":"","category":"section"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"You can remove a project:","category":"page"},{"location":"guides/projects/administrate-projects/","page":"Interact with projects","title":"Interact with projects","text":"julia> project(:rm, name = \"first_project\")","category":"page"},{"location":"quick_start/tune-your-first-controller/#Tune-your-first-controller","page":"Tune your first controller","title":"Tune your first controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"From a model, it is possible to create a controller based on model predictive control, and it will be saved on the database. It can be set to be linear or non-linear and the solver can be selected by the user or automatically. In addition, it will be possible to calculate the controller from the initialization of the states to compute the optimal state and input control. In this tutorial you will learn:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Prepare a model for tuning a controller\nTune a linear controller\nTune a non linear controller\nTune a mixed integer controller\nCalculate a controller\nDelete a controller","category":"page"},{"location":"quick_start/tune-your-first-controller/#Prepare-a-model-for-tuning-a-controller","page":"Tune your first controller","title":"Prepare a model for tuning a controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"The following steps are identical to the section Tune your first model they are developed to tune a non-linear model, needed to tune the controller. You can go to the next section if you already have the model.","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Launch AutomationLabs on Julia:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> using AutomationLabs","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Create a project, if not already created:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> project(:create, name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Load the data from a quadruple tank process [1] on the repository data. The data of the dynamical system inputs can be added (you can have a look on Manage your first data):","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  data(\n          :add; \n          project_name = \"QTP_test\", \n          path = \"paht_of_the_CSV_file\",\n          name = \"data_inputs_m3h\",\n       )","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"The outputs of the dynamical system can be added to the database:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> data(\n          :add; \n          project_name = \"QTP_test\", \n          path = \"paht_of_the_CSV_file\",\n          name = \"data_outputs\",\n       )","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Create the io data with bound on the raw data:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  lower_in = [0.2 0.2 0.2 0.2 -Inf -Inf]\n        upper_in = [1.2 1.2 1.2 1.2 Inf Inf]\n        lower_out = [0.2 0.2 0.2 0.2]\n        upper_out = [1.2 1.2 1.2 1.2]\n\n        data(:io;\n                inputs_data_name =  \"data_inputs_m3h\",\n                outputs_data_name = \"data_outputs\",\n                project_name = \"QTP_test\", \n                data_name = \"io_qtp\",\n                data_lower_input = lower_in,\n                data_upper_input = upper_in,\n                data_lower_output = lower_out,\n                data_upper_output = upper_out,\n            )","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Tune a non-linear model for dynamical system identification, such as:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> using Dates ","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> model(:tune; \n          project_name = \"QTP_test\",\n          model_name = \"model_qtp_nonlinear\",\n          io = \"io_qtp\",\n          computation_solver = \"radam\",\n          computation_maximum_time = Dates.Minute(15),\n          model_architecture = \"fnn\", \n          )","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"You now have a model of the quadruple tank process. It is now possible to go to the creation of the controller to control the dynamic system.","category":"page"},{"location":"quick_start/tune-your-first-controller/#Tune-a-linear-controller","page":"Tune your first controller","title":"Tune a linear controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"The first desired controller is a linear model predictive control with a quadratic cost function. To learn more about the control you can go to the guides section:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Model predictive control","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"The linearization of the non linear model is performed at the state and input references. However, it is required to defined the constraints and the references, such as:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  hmin = 0.2;\n        h1max = 1.36;\n        h2max = 1.36;\n        h3max = 1.30;\n        h4max = 1.30;\n        qmin = 0;\n        qamax = 4;\n        qbmax = 3.26;\n\n        #Constraint definition:\n        mpc_lower_state_constraints = [hmin, hmin, hmin, hmin]\n        mpc_higher_state_constraints = [h1max, h2max, h3max, h4max]\n        mpc_lower_input_constraints = [qmin, qmin]\n        mpc_higher_input_constraints = [qamax, qbmax]\n\n        mpc_state_reference = [0.65, 0.65, 0.65, 0.65]\n        mpc_input_reference = [1.2, 1.2]","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Now we can set up the controller:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  c = controller(:tune; \n                project_name = \"QTP_test\",\n                model_name = \"model_qtp_nonlinear\",\n                controller_name = \"linear_controller\",\n                mpc_controller_type = \"model_predictive_control\",\n                mpc_programming_type = \"linear\",\n                mpc_lower_state_constraints = mpc_lower_statie_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,       \n            ) ","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"where project_name is the related project, model_name is the name used for tuning the controller, mpc_controller_type is the related control, mpc programming_type is the implementation method, mpc_lower_state_constraints is the state constraints, mpc_higher_sate_constraints is the state constraints, mpc_lower_input_constraints is the input control constraints, mpc_higher_input_constraints is the input control constraints, mpc_horizon is the horizon length, mpc_sample_time is the time between two samples, mpc_state_reference is the state reference and mpc_input_reference is the input reference related to the model predictive control.","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"You can list the controller from the project:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> controller(:ls, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"(Image: plot-ls-controller-temporal-terminal)","category":"page"},{"location":"quick_start/tune-your-first-controller/#Tune-a-non-linear-controller","page":"Tune your first controller","title":"Tune a non-linear controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Previously we tuned a linear controller, we can also tune a non linear controller easily by changing the parameter mpc_programming_type, such as:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  c2 = controller(:tune; \n                project_name = \"QTP_test\",\n                model_name = \"model_qtp_nonlinear\",\n                controller_name = \"non_linear_controller\",\n                mpc_controller_type = \"model_predictive_control\",\n                mpc_programming_type = \"non_linear\",\n                mpc_lower_state_constraints = mpc_lower_state_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,    \n                mpc_solver = \"ipopt\"   \n         )    ","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"where project_name is the related project, model_name is the name used for tuning the controller, mpc_controller_type is the related control, mpc programming_type is the implementation method, mpc_lower_state_constraints is the state constraints, mpc_higher_sate_constraints is the state constraints, mpc_lower_input_constraints is the input control constraints, mpc_higher_input_constraints is the input control constraints, mpc_horizon is the horizon length, mpc_sample_time is the time between two samples, mpc_state_reference is the state reference, mpc_input_reference is the input reference related to the model predictive control and mpc_solver allows you to choose the resolution solver.","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"You can list the controller from the project:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> controller(:ls, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"(Image: plot-ls-controller-temporal-terminal)","category":"page"},{"location":"quick_start/tune-your-first-controller/#Tune-a-mixed-integer-controller","page":"Tune your first controller","title":"Tune a mixed integer controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"Previously we tuned a non-linear model based on feedforward neural networks. The activation functions were relu. In this case it is possible to take into account the particularity of this activation function to reformulate the optimization problem with integer numbers. We can tune a controller with mixed integer programming, such as:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> c3 = controller(:tune; \n                project_name = \"QTP_test\",\n                model_name = \"model_qtp_nonlinear\",\n                controller_name = \"mixed_linear_controller\",\n                mpc_controller_type = \"model_predictive_control\",\n                mpc_programming_type = \"mixed_linear\",\n                mpc_lower_state_constraints = mpc_lower_state_constraints,\n                mpc_higher_state_constraints = mpc_higher_state_constraints,\n                mpc_lower_input_constraints = mpc_lower_input_constraints,\n                mpc_higher_input_constraints = mpc_higher_input_constraints,\n                mpc_horizon = 6,\n                mpc_sample_time = 5,\n                mpc_state_reference = mpc_state_reference,\n                mpc_input_reference = mpc_input_reference,    \n         )","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"where project_name is the related project, model_name is the name used for tuning the controller, mpc_controller_type is the related control, mpc programming_type is the implementation method, mpc_lower_state_constraints is the state constraints, mpc_higher_sate_constraints is the state constraints, mpc_lower_input_constraints is the input control constraints, mpc_higher_input_constraints is the input control constraints, mpc_horizon is the horizon length, mpc_sample_time is the time between two samples, mpc_state_reference is the state reference andmpc_input_reference is the input reference related to the model predictive control.","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"You can list the controller from the project:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> controller(:ls, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"(Image: plot-ls-controller-temporal-terminal)","category":"page"},{"location":"quick_start/tune-your-first-controller/#Calculate-a-controller","page":"Tune your first controller","title":"Calculate a controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"We can calculate the controller with a state intialization (or state measure), such as:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> initialization = [0.6, 0.6, 0.6, 0.6]","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> c = controller(:calculate; initialization =  initialization, predictive_controller = c)\n       c2 = controller(:calculate; initialization =  initialization, predictive_controller = c2)\n       c3 = controller(:calculate; initialization =  initialization, predictive_controller = c3)","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"where initialization is the state initialization or the state measure and predictive_controller is the controller to calculate.","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"We can retrieve the computed state:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  c.computation_results.x\n        c2.computation_results.x\n        c3.computation_results.x","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"(Image: plot-controller-results-terminal)","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"We can retrieve the computed input control:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia>  c.computation_results.u","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"(Image: plot-controller-results-terminal)","category":"page"},{"location":"quick_start/tune-your-first-controller/#Delete-a-controller","page":"Tune your first controller","title":"Delete a controller","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"It is possible to delete the tuned controllers from the database, such as:","category":"page"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"julia> controller(:rm, project_name = \"QTP_test\", controller_name = \"non_linear_controller\")","category":"page"},{"location":"quick_start/tune-your-first-controller/#Reference","page":"Tune your first controller","title":"Reference","text":"","category":"section"},{"location":"quick_start/tune-your-first-controller/","page":"Tune your first controller","title":"Tune your first controller","text":"[1] Blaud, P. C., Chevrel, P., Claveau, F., Haurant, P., & Mouraud, A. (2022). ResNet and PolyNet based identification and (MPC) control of dynamical systems: a promising way. IEEE Access.","category":"page"},{"location":"guides/models/administrate-models/#Interact-with-models","page":"Interact with models","title":"Interact with models","text":"","category":"section"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"You can interact with the model to tune a model from io data for dynamical system identification. In addition, a large number of parameters are available to select the model to be tuned and the optimization algorithm.","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"(Image: image-dynamical-system-1)","category":"page"},{"location":"guides/models/administrate-models/#Tune-a-model","page":"Interact with models","title":"Tune a model","text":"","category":"section"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"To tune and calibrate a model whether it is black box or grey box you can use the command :tune:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"lls\",\n        model_architecture = \"linear\", \n    )","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"where project_name is the name of the project, model_name is the model name when saved on the database, io is the data used to tune the model, computation_solver is the solver used to tune the model, computation_maximum_time is the time allocated to tune the model and model_architecture is the model architecture.","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"The blackbox models which can be selected are visible in section blackbox model’s description :","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":" Blackbox models description","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"During a model tuning, a hyperparameters optimization is performed with a meta_heuristic algorithm. More information is provided in the following section:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"Hyperparameters optimization","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"Furthermore, in order to measure the identification performance of a model, a cost function is used, which is presented in the section:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"Loss function","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"It is possible to add extra parameters to tune a model from io data, depending on blackbox model. All the parameters are listed on parameters section:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"Parameters models","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"Finally, the available solvers to tune a model are depicted in solvers section:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"Solvers","category":"page"},{"location":"guides/models/administrate-models/#List-models","page":"Interact with models","title":"List models","text":"","category":"section"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"You can list the models from a project:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"julia> model(:ls, project_name = \"project_1\")","category":"page"},{"location":"guides/models/administrate-models/#Remove-a-model","page":"Interact with models","title":"Remove a model","text":"","category":"section"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"You can remove a model from a dedicated project:","category":"page"},{"location":"guides/models/administrate-models/","page":"Interact with models","title":"Interact with models","text":"julia> model(:rm, project_name = \"project_1\", model_name = \"model_name\")","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Planned-for-v0.2.x","page":"Planned for v2.0.x","title":"Planned for v0.2.x","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/#Model-identification","page":"Planned for v2.0.x","title":"Model identification","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"It is planned to add parametric models such as ARX, OE or ARMAX.","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Controller","page":"Planned for v2.0.x","title":"Controller","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"It is planned to add the terminal ingredient on the model predictive control.","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Export","page":"Planned for v2.0.x","title":"Export","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"It is planned to add the capability to export a model, a controller or a dashboard. The model and controller export should be simulable on Modelica or Simulink.","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Python-API","page":"Planned for v2.0.x","title":"Python API","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"It is planned a Python api.","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Matlab-API","page":"Planned for v2.0.x","title":"Matlab API","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"It is planned a Matlab api.","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Use-case","page":"Planned for v2.0.x","title":"Use case","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"It is planned to develop a number of case studies of dynamic system identification and energy system control, such as:","category":"page"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"Control of a residential house heating system;\nControl of a combined-heat and power;","category":"page"},{"location":"roadmap/planned-for-v0.2.x/#Other","page":"Planned for v2.0.x","title":"Other","text":"","category":"section"},{"location":"roadmap/planned-for-v0.2.x/","page":"Planned for v2.0.x","title":"Planned for v2.0.x","text":"You can indicate a feature request.","category":"page"},{"location":"guides/models/solvers/#Solvers","page":"Solvers","title":"Solvers","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"There are different solvers to tune the model and minimize the loss function.","category":"page"},{"location":"guides/models/solvers/#Linear-programming","page":"Solvers","title":"Linear programming","text":"","category":"section"},{"location":"guides/models/solvers/#Linear-least-squares-(lls)","page":"Solvers","title":"Linear least squares (lls)","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The lls used the least square approximation of a linear function to data, and it can be used to tune the linear model. The selection of LLS is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"lls\",\n        model_architecture = \"linear\", \n    )","category":"page"},{"location":"guides/models/solvers/#Non-linear-programming","page":"Solvers","title":"Non linear programming","text":"","category":"section"},{"location":"guides/models/solvers/#Backpropagation-through-time","page":"Solvers","title":"Backpropagation through time","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The gradient-based back-propagation algorithm [1] [2] allows iteratively tunes weights and bias of neurons and bias [3]:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"W = W + Delta W","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"b + b + Delta b","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"where W is the weighting vector, ∆W is the increment vector, b is the bias and ∆b is the increment vector. The increment vectors are:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"Delta W = eta fracpartial Lpartial W","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"Delta b = eta fracpartial Lpartial b","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"with η the learning rate and L a loss function. The learning rate is sensitive in regard to stability and training performance with respect to identification performance. Large value derives in lack of robustness in convergence and small value derives in lack of identification accuracy. In order to boost neural network training performance, we selected stochastic gradient descent Adam optimizer [4] and derivative Radam [5], Nadam [6], Oadam [7]. They allow to fine tune the learning rate during training.","category":"page"},{"location":"guides/models/solvers/#Adam","page":"Solvers","title":"Adam","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of Adam is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"adam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#Radam","page":"Solvers","title":"Radam","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of Radam is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"radam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#Nadam","page":"Solvers","title":"Nadam","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of Nadam is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"nadam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#Oadam","page":"Solvers","title":"Oadam","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of Oadam is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"oadam\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#Other-non-linear-solvers","page":"Solvers","title":"Other non linear solvers","text":"","category":"section"},{"location":"guides/models/solvers/#**Limited-memory-Broyden-Fletcher-Goldfarb-Shanno**-(LBFGS)","page":"Solvers","title":"Limited-memory Broyden Fletcher Goldfarb Shanno (LBFGS)","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of LBFGS [10] is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"lbfgs\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#Objective-acceleration-(OACCEL)","page":"Solvers","title":"Objective acceleration (OACCEL)","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of Oaccel [8] is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"oaccel\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#Particle-swarm-optimization-(PSO)","page":"Solvers","title":"Particle swarm optimization (PSO)","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"The selection of PSO [9] is done by computation_solver parameter, such as:","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"julia> model(:tune; \n        project_name = \"project_1\",\n        model_name = \"model_name\",\n        io = \"io_name\",\n        computation_solver = \"pso\",\n        computation_maximum_time = Dates.Minute(5),\n        model_architecture = \"fnn\", \n    )","category":"page"},{"location":"guides/models/solvers/#References","page":"Solvers","title":"References","text":"","category":"section"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[1] LeCun, Y. (1985). Une procedure d'apprentissage pour reseau a seuil asymetrique. Proceedings of Cognitiva 85, 599-604.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[2] Rumelhart, D. E., Hinton, G. E., & Williams, R. J. (1986). Learning representations by back-propagating errors. nature, 323(6088), 533-536.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[3] Blaud, P. C., Chevrel, P., Claveau, F., Haurant, P., & Mouraud, A. (2022). ResNet and PolyNet based identification and (MPC) control of dynamical systems: a promising way. IEEE Access.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[4] Kingma, D. P., & Ba, J. (2014). Adam: A method for stochastic optimization. International Conference on Learning Representations (ICLR), San Diego, CA, USA.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[5] Liu, L., Jiang, H., He, P., Chen, W., Liu, X., Gao, J., & Han, J. (2019). On the variance of the adaptive learning rate and beyond. International Conference on Learning Representations (ICLR), Addis Ababa, Ethiopia.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[6] Dozat, T. (2016). Incorporating nesterov momentum into adam.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[7] Daskalakis, C., Ilyas, A., Syrgkanis, V., & Zeng, H. (2017). Training gans with optimism. International Conference on Learning Representations (ICLR), Vancouver, BC, Canada.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[8] Riseth, A. N. (2019). Objective acceleration for unconstrained optimization. Numerical Linear Algebra with Applications, 26(1).","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[9] Bonyadi, M. R., & Michalewicz, Z. (2017). Particle swarm optimization for single objective continuous space problems: a review. Evolutionary computation, 25(1), 1-54.","category":"page"},{"location":"guides/models/solvers/","page":"Solvers","title":"Solvers","text":"[10] Liu, D. C., & Nocedal, J. (1989). On the limited memory BFGS method for large scale optimization. Mathematical programming, 45(1), 503-528.","category":"page"},{"location":"quick_start/manage-your-first-data/#Manage-your-first-data","page":"Manage your first data","title":"Manage your first data","text":"","category":"section"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"Before identifying a model of the dynamic system, it is necessary to store the data of the dynamic system on the database. In this tutorial you will learn:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"Load data\nInput-output data\nDelete data","category":"page"},{"location":"quick_start/manage-your-first-data/#Load-data","page":"Manage your first data","title":"Load data","text":"","category":"section"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"AutomationLabs can load CSV file to store the data on database and carry out processing on the data. Also, the data will allow the identification of a model. For a quick start, we will use in this example the data from the article [1]. The data can be downloaded on the quadruple tank process  repository. The dynamical system has four tanks, two pumps and two three-way valves.","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"(Image: quadruple-tank-process)","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"Launch the AutomationLabs:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> using AutomationLabs","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"You can create a new project, because the data, the models, the controllers and the plots are located on a project:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> project(:create, name = \"QTP_test\")","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"You can also, list all the project that are available on the database:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> project(:ls)","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"(Image: project-termianl)","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"The inputs of the dynamical system are added to the database:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia>  data(\n          :add; \n          project_name = \"QTP_test\", \n          path = \"path_of_the_CSV_file\",\n          name = \"data_inputs_m3h\",\n       )","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"The outputs of the dynamical system are added to the database:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> data(\n          :add; \n          project_name = \"QTP_test\", \n          path = \"path_of_the_CSV_file\",\n          name = \"data_outputs\",\n       )","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"You can list the raw data that are available on the database, such as:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> data(:lsraw, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"(Image: lsraw-terminal)","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"Finally, it is possible to plot the raw data that you have added on the database with the dash command:&#x20;","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> dash(:rawdata, \n                project_name = \"QTP_test\",\n                data_name = \"data_inputs_m3h\",\n                recipe = \"temporal\",\n                dash_name = \"inputs_plot\",\n                )","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"(Image: plot-temporal-terminal)","category":"page"},{"location":"quick_start/manage-your-first-data/#Input-output-data","page":"Manage your first data","title":"Input-output data","text":"","category":"section"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"In order to perform a model identification, the data need to be formatted. As such the io data is introduced:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> data(:io,\n              inputs_data_name =  \"data_inputs_m3h\",\n              outputs_data_name = \"data_outputs\",\n              project_name = \"QTP_test\", \n              data_name = \"io1\",\n    )","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"where :io is the input-output information, inputs_data_name is the raw data of the dynamical system inputs, outputs_data_name is the raw data of the dynamical system outputs, project_name is the project where the raw are located and where the io data will be located, data_name is the name of the io data. There are additional parameters that allow the data to be processed. For example, it is possible to set a low or high limit on the data, more information can be found in the guides section:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"Interact with data","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"You can list all the io data available on a project:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> data(:lsio, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"It is possible to plot the io data that you have processed with the dash command:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> dash(:iodata, \n                project_name = \"QTP_test\",\n                data_name = \"io1\",\n                recipe = \"temporal\",\n                dash_name = \"io_plot\",\n        )","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"(Image: plot-io-temporal-terminal)","category":"page"},{"location":"quick_start/manage-your-first-data/#Delete-data","page":"Manage your first data","title":"Delete data","text":"","category":"section"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"It is possible to delete the data, such as:","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> data(:rmio, project_name = \"QTP_test\", data_name = \"io1\")","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> model(:rmraw, project_name = \"QTP_test\", data_name = \"data_outputs\")","category":"page"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"julia> model(:rmraw, project_name = \"QTP_test\", data_name = \"data_intputs_m3h\")","category":"page"},{"location":"quick_start/manage-your-first-data/#Reference","page":"Manage your first data","title":"Reference","text":"","category":"section"},{"location":"quick_start/manage-your-first-data/","page":"Manage your first data","title":"Manage your first data","text":"[1] Blaud, P. C., Chevrel, P., Claveau, F., Haurant, P., & Mouraud, A. (2022). ResNet and PolyNet based identification and (MPC) control of dynamical systems: a promising way. IEEE Access.","category":"page"},{"location":"quick_start/tune-your-first-model/#Tune-your-first-model","page":"Tune your first model","title":"Tune your first model","text":"","category":"section"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"From the data added in the database, you can identify the dynamic system and thus obtain a model. This model can be linear or non-linear according to your selection. Furthermore, there are different methods to tune the model parameters while optimizing the hyperparameters. In this tutorial you will learn:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"Prepare the data\nTune a linear model\nTune a non linear model\nDelete the models","category":"page"},{"location":"quick_start/tune-your-first-model/#Prepare-the-data","page":"Tune your first model","title":"Prepare the data","text":"","category":"section"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"Launch AutomationLabs on Julia:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> using AutomationLabs","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"Create a project, if not already created:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> project(:create, name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"Load the data from a quadruple tank process [1] on the repository data. The data of the dynamical system inputs can be added (you can have a look on Manage your first data):","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia>  data(\n          :add; \n          project_name = \"QTP_test\", \n          path = \"paht_of_the_CSV_file\",\n          name = \"data_inputs_m3h\",\n       )","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"The outputs of the dynamical system can be added to the database:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> data(\n          :add; \n          project_name = \"QTP_test\", \n          path = \"paht_of_the_CSV_file\",\n          name = \"data_outputs\",\n       )","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"Create the io data with bound on the raw data:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia>  lower_in = [0.2 0.2 0.2 0.2 -Inf -Inf]\n        upper_in = [1.2 1.2 1.2 1.2 Inf Inf]\n        lower_out = [0.2 0.2 0.2 0.2]\n        upper_out = [1.2 1.2 1.2 1.2]\n\n        data(:io;\n                inputs_data_name =  \"data_inputs_m3h\",\n                outputs_data_name = \"data_outputs\",\n                project_name = \"QTP_test\", \n                data_name = \"io_qtp\",\n                data_lower_input = lower_in,\n                data_upper_input = upper_in,\n                data_lower_output = lower_out,\n                data_upper_output = upper_out,\n            )","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"You can list the data from the project:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"(Image: plot-lsio-terminal)","category":"page"},{"location":"quick_start/tune-your-first-model/#Tune-a-linear-model","page":"Tune your first model","title":"Tune a linear model","text":"","category":"section"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"We can now tune the first model. We will perform the identification of the dynamic system by a linear model, such as:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:tune; \n        project_name = \"QTP_test\",\n        model_name = \"model_qtp_linear\",\n        io = \"io_qtp\",\n        model_architecture = \"linear\", \n        computation_solver = \"lls\",\n    )","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"where, project_name is the project where the model will be saved, model_name is the name of the model after tuning, io is the data used for dynamical system identification and model_architecture allows you to select the type of model. So, for a linear model, it is model_architecture = \"Linear\".","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"You can list the model available on the database:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:ls, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"(Image: plot-ls-model-terminal)","category":"page"},{"location":"quick_start/tune-your-first-model/#Tune-a-non-linear-model","page":"Tune your first model","title":"Tune a non linear model","text":"","category":"section"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"It possible to tune a non-linear model for dynamical system identification, such as:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> using Dates ","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:tune; \n          project_name = \"QTP_test\",\n          model_name = \"model_qtp_nonlinear\",\n          io = \"io_qtp\",\n          computation_solver = \"radam\",\n          computation_maximum_time = Dates.Minute(15),\n          model_architecture = \"fnn\", \n          )","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"where, computation_maximum_time is the time allocated for tuning with the hyperparameters optimization and it requires Dates package.  model_architecture allows you to select the type of model. So, for a non-linear model with a feedforward neural networks, it is model_architecture = \"Fnn\". For example, it is possible to set other parameters, more information can be found in the guides section:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"Interact with models","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"It is possible to present information about the best tuning model:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:stats, model_name = \"model_qtp_nonlinear\", project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"(Image: plot-stats-model-terminal)","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"You can list the models available on the database:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:ls, project_name = \"QTP_test\")","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"(Image: plot-models-terminal)","category":"page"},{"location":"quick_start/tune-your-first-model/#Delete-the-models","page":"Tune your first model","title":"Delete the models","text":"","category":"section"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"It is possible to delete the tuned models, such as:","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:rm, project_name = \"QTP_test\", model_name = \"model_qtp_nonlinear\")","category":"page"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"julia> model(:rm, project_name = \"QTP_test\", model_name = \"model_qtp_linear\")","category":"page"},{"location":"quick_start/tune-your-first-model/#Reference","page":"Tune your first model","title":"Reference","text":"","category":"section"},{"location":"quick_start/tune-your-first-model/","page":"Tune your first model","title":"Tune your first model","text":"[1] Blaud, P. C., Chevrel, P., Claveau, F., Haurant, P., & Mouraud, A. (2022). ResNet and PolyNet based identification and (MPC) control of dynamical systems: a promising way. IEEE Access.","category":"page"},{"location":"#AutomationLabs.jl-documentation","page":"AutomationLabs.jl documentation","title":"AutomationLabs.jl documentation","text":"","category":"section"},{"location":"","page":"AutomationLabs.jl documentation","title":"AutomationLabs.jl documentation","text":"Welcome to the documentation for AutomationLabs.jl package. Here, you can find all the necessary resources you need.","category":"page"},{"location":"#How-the-documentation-is-structured","page":"AutomationLabs.jl documentation","title":"How the documentation is structured","text":"","category":"section"},{"location":"","page":"AutomationLabs.jl documentation","title":"AutomationLabs.jl documentation","text":"Installation contains information how to install the package.\nQuick start contains essential information how to use the package (it is a good first approach).\nGuides contains detailed information about the package.\nReference contains a list of the package function.\nCollaboration contains a list of recommendations for contributions and information when expert support is needed.\nRoadmap contains a list of future development.","category":"page"},{"location":"","page":"AutomationLabs.jl documentation","title":"AutomationLabs.jl documentation","text":"warning: Warning\nAutomation Labs package is in early stage, the API is subject to breaking changes during minor or major releases without warning.","category":"page"},{"location":"","page":"AutomationLabs.jl documentation","title":"AutomationLabs.jl documentation","text":"note: Note\nYou can contribute by report issues with the Github issue tracker. All types of issues are welcome and encouraged, such as: bug reports, documentation typos, feature requests or example requests.","category":"page"},{"location":"#Summary","page":"AutomationLabs.jl documentation","title":"Summary","text":"","category":"section"},{"location":"","page":"AutomationLabs.jl documentation","title":"AutomationLabs.jl documentation","text":"Installation with Julia\nIntroduction quick start\nIntroduction guides\nCLI\nHow to contribute\nPlanned for v0.2.x","category":"page"},{"location":"guides/data/administrate-data/#Interact-with-data","page":"Interact with data","title":"Interact with data","text":"","category":"section"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"With AutomationLabs there are two kinds of data:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"raw data: data that users can store on the database and local folder.\nio data: data where data processing has been performed for model identification. The io data are used by AutomationLabs to tune models and they are derived from the raw data.","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"Furthermore, AutomationLabs depicts data in inputs vs output manner, such as:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"(Image: image-dynamical-system-input-output)","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"We can introduce the state of dynamical system, noted as x(t) and the inputs of the dynamical system noted as u(t). It is assumed that the state of our dynamic system is the measured output:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"(Image: image-dynamical-system-input-output-u-x)","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"AutomationLabs is a computer tool and there is discretized data management, the state and inputs are noted as: xkand ukwith k in mathbbN_ge 0the sample index, xk=x(t_k) t_k = k times T_s, with T_sthe sample time.","category":"page"},{"location":"guides/data/administrate-data/#Add-raw-data","page":"Interact with data","title":"Add raw data","text":"","category":"section"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"You can add raw data on the database on a dedicated project:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"julia> project(:create, name = \"project_1\")\njulia> data(:add; project_name = \"project_1\", path = \"path_to_data\", name = \"data_inputs_m3h\")","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"path allows you to specify the folder path where the data are located on the hard drive, and name the name of file. Also, please note that the file extension need to be .CSV.","category":"page"},{"location":"guides/data/administrate-data/#List-raw-data","page":"Interact with data","title":"List raw data","text":"","category":"section"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"You can list the raw data on the database:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"julia> data(:lsraw, project_name = \"project_1\")","category":"page"},{"location":"guides/data/administrate-data/#io-data","page":"Interact with data","title":"io data","text":"","category":"section"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"The raw data are not directly used to identify a dynamical system and to get a model from data. It is necessary to process the data. The purpose of a model is to predict the state at the next sample index hatxk+1with the state and the input at the current sample index.","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"(Image: model-dynamical-system)","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"The mathematical formulation of the model with the state and input is:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"hatxk+1 = f(xk uk)","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"where hatxk+1 is the predicted states of the dynamical system, xkis the state of the dynamical system at current time, uk is the dynamical system inputs at current time, and fis the unknown mathematical formulation of the dynamical system model.","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"The io data command can manage the raw data to get the predicted state as the outputs of the model and the current state and the input as the inputs of the model:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"julia> data(:io;\n        inputs_data_name =  \"input_raw_data\",\n        outputs_data_name = \"outputs_raw_data\",\n        project_name = \"project_1\", \n        data_name = \"io_name\"\n    )","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"It is possible to add extra parameters to process the raw data when creating io data. For instance, deep time delay with n_delay, data normalization with normalization,  data limit with lower or upper bound, data_lower_input, data_upper_input, data_lower_output, data_upper_output, data_type.","category":"page"},{"location":"guides/data/administrate-data/#List-io-data","page":"Interact with data","title":"List io data","text":"","category":"section"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"You can list the io data located on the database:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"julia> data(:lsio, project_name = \"project_1\")","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"You can also list the raw and io data at the same time:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"julia> data(:ls, project_name = \"project_1\")","category":"page"},{"location":"guides/data/administrate-data/#Remove-data","page":"Interact with data","title":"Remove data","text":"","category":"section"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"You can remove raw or io data from the database:","category":"page"},{"location":"guides/data/administrate-data/","page":"Interact with data","title":"Interact with data","text":"julia> data(:rmraw, project_name = \"project_1\", data_name = \"input_raw_data\")\njulia> data(:rmio, project_name = \"project_1\", data_name = \"io_name\")","category":"page"},{"location":"guides/controllers/parameters/#Parameters","page":"Parameters","title":"Parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/#:tune","page":"Parameters","title":":tune","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Tune a controller from a model.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: controller\nExample: controller(:tune, project_name = \"project1\", model_name = \"model1\", )","category":"page"},{"location":"guides/controllers/parameters/#Mandatory-parameters","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"The following parameters are mandatories in order to tune a controller from a model.","category":"page"},{"location":"guides/controllers/parameters/#project_name","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set project name of the tuning controller.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, project_name = \"project1\")","category":"page"},{"location":"guides/controllers/parameters/#model_name","page":"Parameters","title":"model_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set model name of the tuning controller.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, model_name = \"model1\")","category":"page"},{"location":"guides/controllers/parameters/#mpc_lower_state_constraints","page":"Parameters","title":"mpc_lower_state_constraints","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the lower model predictive contraints of the state.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_lower_state_constraints = [0.2 , 0.2])","category":"page"},{"location":"guides/controllers/parameters/#mpc_higher_state_constraints","page":"Parameters","title":"mpc_higher_state_constraints","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the higher model predictive contraints of the state.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_higher_state_constraints = [2 , 2])","category":"page"},{"location":"guides/controllers/parameters/#mpc_lower_input_constraints","page":"Parameters","title":"mpc_lower_input_constraints","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the lower model predictive contraints of the input.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_lower_input_constraints = [1 , 1])","category":"page"},{"location":"guides/controllers/parameters/#mpc_higher_input_constraints","page":"Parameters","title":"mpc_higher_input_constraints","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the lower model predictive contraints of the input.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_lower_input_constraints = [10 , 10])","category":"page"},{"location":"guides/controllers/parameters/#mpc_horizon","page":"Parameters","title":"mpc_horizon","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the horizon length of the model predictive control or economic model predictive control.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: integer\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_horizon = 25)","category":"page"},{"location":"guides/controllers/parameters/#mpc_state_reference","page":"Parameters","title":"mpc_state_reference","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the state reference of the model predictive control. The references are also used as a linearized point when a linear controller is requested from a non linear model.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_state_reference = [0.5, 0.5])","category":"page"},{"location":"guides/controllers/parameters/#mpc_input_reference","page":"Parameters","title":"mpc_input_reference","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the input reference of the model predictive control. The references are also used as a linearized point when a linear controller is requested from a non linear model.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_input_reference = [1, 1])","category":"page"},{"location":"guides/controllers/parameters/#mpc_sample_time","page":"Parameters","title":"mpc_sample_time","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the sample time of the model predictive control or economic model predictive control.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: integer\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_sample_time = 5)","category":"page"},{"location":"guides/controllers/parameters/#Optional-parameters","page":"Parameters","title":"Optional parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/#controller_name","page":"Parameters","title":"controller_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the controller name on the database to create.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: random\nAccepted: string\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, controller_name = \"controller1\")","category":"page"},{"location":"guides/controllers/parameters/#mpc_controller_type","page":"Parameters","title":"mpc_controller_type","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the model predictive control or the economic model predictive control.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: \"modelpredictivecontrol\"\nAccepted: string, modelpredictivecontrol , economicmodelpredictive_control\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_controller_type = \"model_predictive_control\")","category":"page"},{"location":"guides/controllers/parameters/#mpc_programming_type","page":"Parameters","title":"mpc_programming_type","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the model predictive control implementation type.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: NonLinear\nAccepted: string, Linear, NonLinear, MixedLinear\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_programming_type = \"non_linear\")","category":"page"},{"location":"guides/controllers/parameters/#mpc_solver","page":"Parameters","title":"mpc_solver","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the solver of the model predictive control or economic model predictive control.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: automatic according to the model and mpc_programming_type\nAccepted: string, osqp, scip, mosek, ipopt, highs\nMethod argument: controller(:tune, ...)\nExample: controller(:tune, mpc_solver = \"ipopt\")","category":"page"},{"location":"guides/controllers/parameters/#:calculate","page":"Parameters","title":":calculate","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Calculate (or compute) a controller with initialization state.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: controller\nExample: controller(:calculate, initialization = [0.5])","category":"page"},{"location":"guides/controllers/parameters/#Mandatory-parameters-2","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/#initialization","page":"Parameters","title":"initialization","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the state initialization (or measure) of the controller to calculate.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: vector\nMethod argument: controller(:calculate, ...)\nExample: controller(:calculate, initialization = [0.3, 0.3])","category":"page"},{"location":"guides/controllers/parameters/#:load","page":"Parameters","title":":load","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Load a controller from the database in order to calculate the controller.","category":"page"},{"location":"guides/controllers/parameters/#Mandatory-parameters-3","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/#project_name-2","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the project name of the controller to load.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:load, ...)\nExample: controller(:load, project_name = \"project1\")","category":"page"},{"location":"guides/controllers/parameters/#controller_name-2","page":"Parameters","title":"controller_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the controller name of the controller to load.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:load, ...)\nExample: controller(:load, controller_name = \"controller1\")","category":"page"},{"location":"guides/controllers/parameters/#:ls","page":"Parameters","title":":ls","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"List the controller that are available.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: controller\nExample: controller(:ls, project_name = \"project1\")","category":"page"},{"location":"guides/controllers/parameters/#Mandatory-parameters-4","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/#project_name-3","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the project name of the controller to list.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:ls, ...)\nExample: controller(:ls, project_name = \"project1\")","category":"page"},{"location":"guides/controllers/parameters/#:rm","page":"Parameters","title":":rm","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Remove a controller from a project.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: nothing\nMethod argument: controller\nExample: controller(:rm, project_name = \"project1\")","category":"page"},{"location":"guides/controllers/parameters/#Mandatory-parameters-5","page":"Parameters","title":"Mandatory parameters","text":"","category":"section"},{"location":"guides/controllers/parameters/#project_name-4","page":"Parameters","title":"project_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the project name of the controller to remove.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:rm, ...)\nExample: controller(:rm, project_name = \"project1\")","category":"page"},{"location":"guides/controllers/parameters/#controller_name-3","page":"Parameters","title":"controller_name","text":"","category":"section"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Set the controller name of the controller to remove.","category":"page"},{"location":"guides/controllers/parameters/","page":"Parameters","title":"Parameters","text":"Default value: nothing\nAccepted: string\nMethod argument: controller(:remove, ...)\nExample: controller(:rm, controller_name = \"controller1\")","category":"page"}]
